import React from "react";
import Header from "./header";
import Footer from "./footer";
import Note from "./note";
import Keep from "./keep";


function App() {
    return ( <
            div >
            <
            Header / > {
                Keep.map((noteItem) => <
                    Note key = { noteItem.key }
                    title = { noteItem.title }
                    content = { noteItem.content }
                    / > )} <
                    Footer / >
                    <
                    /div>
                );
            }

            export default App;
